import { Component, OnDestroy, OnInit } from '@angular/core';
import * as datamatic from 'datamatic';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit, OnDestroy {
  title = 'Datamatic Angular Integration';
  data: string[] = [];
  errorMessage = '';
  private tx: any;
  private subscription: { unsubscribe?: () => void } | null = null;

  ngOnInit() {
    this.tx = new datamatic.Pipeline({
      type: 'array',
      items: {
        type: 'string'
      }
    });

    this.subscription = this.tx.subscribe({
      next: (data: string[]) => {
        this.data = Array.isArray(data) ? data : [];
      },
      error: (error: unknown) => {
        this.errorMessage = `${error ?? 'Unknown error'}`;
      }
    });

    this.runSample();
  }

  ngOnDestroy() {
    this.subscription?.unsubscribe?.();
  }

  runSample() {
    this.errorMessage = '';
    this.tx.write(['alpha', 'beta', 'gamma']);
  }
}
<div class="page">
  <header class="hero">
    <div>
      <p class="eyebrow">Angular + Datamatic (UMD)</p>
      <h1>{{ title }}</h1>
      <p class="lede">
        This example runs a Datamatic pipeline in Angular and renders the
        streamed output below.
      </p>
    </div>
    <button type="button" class="cta" (click)="runSample()">Run sample</button>
  </header>

  <section class="panel">
    <h2>Pipeline output</h2>
    <p class="hint">Latest items emitted by the pipeline.</p>
    <div class="chips">
      <span class="chip" *ngFor="let item of data">{{ item }}</span>
    </div>
    <p class="empty" *ngIf="data.length === 0">No data yet. Click "Run sample".</p>
  </section>

  <section class="panel error" *ngIf="errorMessage">
    <h2>Errors</h2>
    <p>{{ errorMessage }}</p>
  </section>
</div>
